INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description`, `help_type` ) VALUES  ('2', '4', '隐私保护', '<p>&nbsp;</p>\r\n<p align=\"center\" style=\"text-align:center;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">《</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">隐私政策》<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p align=\"right\" style=\"text-align:right;mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\"><o:p>&nbsp;</o:p></span></p>\r\n<p style=\"text-indent:10.5pt;line-height:18.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">【特别提示】请仔细阅读《</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">隐私政策》（尤其是加粗划线的内容）并确定了解我们对您个人信息的收集与处理（包括使用、保存、共享、转让）规则。阅读过程中，如您有任何疑问，可联系我们的客服咨询。当您以适当的方式开始、继续使用我们的产品或服务超过<span lang=\"EN-US\">15</span>日的，您未通过适当的方式联系我们并表达相反意见的，我们将视为您充分理解并同意本政策。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">引言<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\"><span style=\"mso-spacerun:yes\">&nbsp;</span></span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">（<span lang=\"EN-US\">&ldquo;</span>我们<span lang=\"EN-US\">&rdquo;</span>）非常重视用户的隐私和个人信息保护。您在使用我们的产品与<span lang=\"EN-US\">/</span>或服务时，我们可能会收集和处理您的相关信息。我们希望通过《</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">隐私政策》（<span lang=\"EN-US\">&ldquo;</span>本隐私政策<span lang=\"EN-US\">&rdquo;</span>）向您说明我们在您使用我们的产品与<span lang=\"EN-US\">/</span>或服务时如何收集、使用、保存、共享和转让这些信息，以及我们为您提供的访问、更新、删除和保护这些信息的方式。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">本政策将帮助您了解以下内容：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"margin-left:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">一、 我们如何收集和使用您的个人信息<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"margin-left:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">二、 我们如何使用<span lang=\"EN-US\"> Cookie </span>和同类技术<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"margin-left:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">三、 我们如何共享、转让、公开披露您的个人信息<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"margin-left:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">四、 我们如何保护和保存您的个人信息<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"margin-left:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">五、 您如何管理个人信息<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"margin-left:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">六、 通知和修订<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"margin-left:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">七、 未成年人的个人信息保护<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"margin-left:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">八、 免责声明（非常重要，请仔细阅读）<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">&nbsp;&nbsp;<o:p></o:p></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">本隐私政策与您所使用的</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">平台服务以及该服务所包括的各种业务功能（以下统称<span lang=\"EN-US\">&ldquo;</span>我们的产品与<span lang=\"EN-US\">/</span>或服务<span lang=\"EN-US\">&rdquo;</span>）息息相关，希望您在使用我们的产品与<span lang=\"EN-US\">/</span>或服务前仔细阅读并确认您已经充分理解本政策所写明的内容，并让您可以按照本隐私政策的指引做出您认为适当的选择。本隐私政策中涉及的相关术语，我们尽量以简明扼要的表述，以便您更好地理解。您使用或在我们更新本隐私政策后（我们会及时提示您更新的情况）继续使用我们的产品与<span lang=\"EN-US\">/</span>或服务超过<span lang=\"EN-US\">15</span>日的，您未通过适当的方式联系我们并表达相反意见的，即意味着您同意本隐私政策<span lang=\"EN-US\">(</span>含更新版本<span lang=\"EN-US\">)</span>内容，并且同意我们按照本隐私政策收集和处理您的相关信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">如对本隐私政策或相关事宜有任何问题、异议、评论、建议、担忧、投诉或举报，您可随时通过官方客服与我们联系 。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">在经与我们沟通后，如您对我们的答复不满意，您可以联系负责个人信息使用相关投诉的有关行业协会、监管部门或权威部门，或者依据适用的法律向具有管辖权的法院提起诉讼。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">&nbsp;</span></strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\"><o:p></o:p></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><strong><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">一、我们如何收集和使用您的个人信息</span></strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\"><o:p></o:p></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.1 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">个人信息是指以电子或者其他方式记录的能够单独或者与其他信息结合识别特定自然人身份或者反映特定自然人活动情况的各种信息。本隐私政策中涉及的个人信息包括但不限于：基本信息；个人上网记录（包括网站浏览记录、软件使用记录、点击记录）；个人常用设备信息（包括硬件型号、设备<span lang=\"EN-US\">MAC</span>地址、操作系统类型、软件列表唯一设备识别码（如<span lang=\"EN-US\">IMEI/android ID/IDFA/OPENUDID/GUID</span>、<span lang=\"EN-US\">SIM</span>卡<span lang=\"EN-US\">IMSI</span>信息等在内的描述个人常用设备基本情况的信息）。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们仅会出于以下目的，收集和使用您的个人信息：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.2.1</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">您须授权我们收集和使用您个人信息的情形<span lang=\"EN-US\">:</span>我们的产品与<span lang=\"EN-US\">/</span>或服务包括核心业务功能和附加功能，其中，核心功能包含了实现网上购物所必须的功能、改进我们的产品与<span lang=\"EN-US\">/</span>或服务所必须的功能及保障交易安全所必须的功能。我们可能会收集和使用下列与您有关的信息才能实现上述这些功能。如果您不提供相关信息，您将无法享受我们提供的核心产品与<span lang=\"EN-US\">/</span>或服务。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.2.2</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">这些功能包括：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.2.2.1</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">用户注册<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">您首先需要注册一个</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">账户成为</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;&#10;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:&#10;-webkit-standard;mso-bidi-font-family:-webkit-standard;color:black\">用户。当您注册时，您需要至少向我们提供您准备使用的</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户名、密码、您本人的手机号码、电子邮箱地址（用于验证邮箱），我们将通过发送短信验证码或邮件的方式来验证您的身份是否有效。您的账户名为您的默认昵称，您可以修改补充您的昵称、性别、生日相关信息，这些信息均属于您的<span lang=\"EN-US\">&ldquo;</span>账户信息<span lang=\"EN-US\">&rdquo;</span>。您补充的账户信息将有助于我们为您提供个性化的商品推荐和更优的购物体验，但如果您不提供这些补充信息，不会影响您网上购物的基本功能。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">&nbsp;<o:p></o:p></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.2.2.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">基于位置信息的个性化推荐功能<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们会收集您的位置信息（我们仅收集您当时所处的地理位置，但不会将您各时段的位置信息进行结合以判断您的行踪轨迹）来判断您所处的地点，自动为您推荐您所在区域可以购买商品或服务的第三方商户。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">上述功能可能需要您在您的设备中向我们开启您的地理位置（位置信息）的访问权限，以实现这些功能所涉及的信息的收集和使用。您可以在您设备设置中进行查看。请您注意，您开启上述权限即代表您授权我们可以收集和使用这些个人信息来实现上述的功能，您关闭权限即代表您取消了这些授权，则我们将不再继续收集和使用您的这些个人信息，也无法为您提供上述与上述授权所对应的功能。您关闭权限的决定不会影响此前基于您的授权所进行的个人信息的处理。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.2.2.3 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">商品信息展示和搜索<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">为了让您快速地找到您所需要的商品，我们可能会收集您使用我们的产品与<span lang=\"EN-US\">/</span>或服务的设备信息（包括设备名称、设备型号、设备识别码、操作系统和应用程序版本、语言设置、分辨率、服务提供商网络<span lang=\"EN-US\">ID</span>（<span lang=\"EN-US\">PLMN</span>））、浏览器类型来为您提供商品信息展示的最优方式。我们也会为了不断改进和优化上述的功能来使用您的上述个人信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">您也可以通过搜索来精准地找到您所需要的商品或服务。我们会保留您的搜索内容以方便您重复输入或为您展示与您搜索内容相关联的商品。 请您注意，您的搜索关键词信息无法单独识别您的身份，不属于您的个人信息，我们有权以任何的目的对其进行使用；只有当您的搜索关键词信息与您的其他信息相互结合使用并可以识别您的身份时，则在结合使用期间，我们会将您的搜索关键词信息作为您的个人信息，与您的搜索历史记录一同按照本隐私政策对其进行处理与保护。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.2.2.4</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">下单<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">当您准备对您购物车内的商品进行结算时，</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">系统会生成您购买该商品的订单。您需要在订单中至少填写您的收货人姓名、收货地址以及手机号码，同时该订单中会载明订单号、您所购买的商品或服务信息、您应支付的货款金额及支付方式；您可以另外填写收货人更多的联系方式确保商品可以准确送达，但不填写这些信息不影响您订单的生成。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">上述所有信息构成您的<span lang=\"EN-US\">&ldquo;</span>订单信息<span lang=\"EN-US\">&rdquo;</span>，我们将使用您的订单信息来进行您的身份核验、确定交易、支付结算、完成配送、为您查询订单以及提供客服咨询与售后服务；我们还会使用您的订单信息来判断您的交易是否存在异常以保护您的交易安全。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.2.2.5 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">支付功能<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">在您下单后，您可以选择</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">的关联方或与</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">合作的第三方支付机构（包括微信支付及银联等支付通道，以下称<span lang=\"EN-US\">&ldquo;</span>支付机构<span lang=\"EN-US\">&rdquo;</span>）所提供的支付服务。支付功能本身并不收集您的个人信息，但我们需要将您的</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">订单号与交易金额信息与这些支付机构共享以实现其确认您的支付指令并完成支付。<span lang=\"EN-US\">&ldquo;</span>关联方<span lang=\"EN-US\">&rdquo;</span>指一方现在或将来控制、受控制或与其处于共同控制下的任何公司、机构以及上述公司或机构的法定代表人。<span lang=\"EN-US\">&ldquo;</span>控制<span lang=\"EN-US\">&rdquo;</span>是指直接或间接地拥有影响所提及公司管理的能力，无论是通过所有权、有投票权的股份、合同或其他被人民法院认定的方式。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.2.2.6 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">交付产品或服务功能<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">在当您下单并完成支付后，与</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">合作的第三方将为您完成订单的交付。您知晓并同意</span><span style=\"font-family:宋体;&#10;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">的关联方或与</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">合作的第三方配送公司会在上述环节内使用您的订单信息以保证您的订购的商品能够安全送达。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.2.2.7 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">客服与售后功能<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们的客服和售后功能会使用您的账号信息和订单信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">为保证您的账号安全，我们的呼叫中心客服和在线客服会使用您的账号信息与您核验您的身份。当您需要我们提供与您订单信息相关的客服与售后服务时，我们将会查询您的订单信息。您有可能会在与我们的客服人员沟通时，提供给出上述信息外的其他信息，如当您要求我们变更配送地址、联系人或联系电话。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.2.3 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">改进我们的产品与<span lang=\"EN-US\">/</span>或服务所必须的功能<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们可能会收集您的订单信息、浏览信息、您的兴趣爱好（您可以在账户设置中选择）进行数据分析以形成用户画像，用来将您感兴趣的商品或服务信息展示给您；或在您搜索时向您展示您可能希望找到的商品。我们还可能为了提供服务及改进服务质量的合理需要而获得的您的其他信息，包括您与客服联系时您提供的相关信息，您参与问卷调查时向我们发送的问卷答复信息，以及您与我们的关联方、我们合作伙伴之间互动时我们获得的相关信息。对于从您的各种设备上收集到的信息，我们可能会将它们进行关联，以便我们能在这些设备上为您提供一致的服务。我们可能会将来自某项服务的信息与来自其他服务的信息结合起来，以便为您提供服务、个性化内容和建议。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.2.4 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">保障交易安全所必须的功能<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">为提高您使用我们的产品与<span lang=\"EN-US\">/</span>或服务时系统的安全性，更准确地预防钓鱼网站欺诈和保护账户安全，我们可能会通过了解您的浏览信息、订单信息、您常用的软件信息、设备信息等手段来判断您的账号风险，并可能会记录一些我们认为有风险的链接（<span lang=\"EN-US\">&ldquo;URL&rdquo;</span>）；我们也会收集您的设备信息对于</span><span style=\"font-family:宋体;&#10;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">系统问题进行分析、统计流量并排查可能存在的风险、在您选择向我们发送异常信息时予以排查。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.3 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">您可选择是否授权我们收集和使用您的个人信息的情形<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.3.1</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">为使您购物更便捷或更有乐趣，从而提升您在</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">的购物体验，我们的以下附加功能中可能会收集和使用您的个人信息。如果您不提供这些个人信息，您依然可以进行网上购物，但您可能无法使用这些可以为您所带来购物乐趣的附加功能或在购买某些商品时需要重复填写一些信息。这些附加功能包括：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">（<span lang=\"EN-US\">a</span>）基于摄像头（相机）的附加功能：您可以使用这个附加功能完成视频拍摄、拍照、扫码登录、人脸识别等功能。未来我们可能会将人脸识别技术应用于更多场景，但那时我们会再次与您确认您是否愿意我们使用您的面部信息来实现这些附加功能。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">（<span lang=\"EN-US\">b</span>）基于图片上传的附加功能：您可以在</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">上传您的照片来实现拍照购物功能和晒单及评价功能，我们会使用您所上传的照片来识别您需要购买的商品或使用包含您所上传图片的评价。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">（<span lang=\"EN-US\">c</span>）基于语音技术的附加功能：您可以直接使用麦克风来进行语音购物或与我们的客服机器人进行咨询和互动。在这些功能中我们会收集您的录音内容以识别您购物需求和客服与售后需求。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.3.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">上述附加功能可能需要您在您的设备中向我们开启您的相机（摄像头）、相册（图片库）、麦克风以及通讯录的访问权限，以实现这些功能所涉及的信息的收集和使用。您可以在您设备设置中进行查看。请您注意，您开启这些权限即代表您授权我们可以收集和使用这些个人信息来实现上述的功能，您关闭权限即代表您取消了这些授权，则我们将不再继续收集和使用您的这些个人信息，也无法为您提供上述与这些授权所对应的功能。您关闭权限的决定不会影响此前基于您的授权所进行的个人信息的处理。<span lang=\"EN-US\"><o:p></o