y:&#10;-webkit-standard;color:black\">1.5.1</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们可能从第三方获取您授权共享的账户信息（头像、昵称），并在您同意本隐私政策后将您的第三方账户与您的</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户绑定，使您可以通过第三方账户直接登录并使用我们的产品与<span lang=\"EN-US\">/</span>或服务。我们会将依据与第三方的约定、对个人信息来源的合法性进行确认后，在符合相关法律和法规规定的前提下，使用您的这些个人信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">&nbsp;1.6 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">您个人信息使用的规则<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.6.1 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们会根据本隐私政策的约定并为实现我们的产品与<span lang=\"EN-US\">/</span>或服务功能对所收集的个人信息进行使用。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">1.6.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">在收集您的个人信息后，我们将通过技术手段对数据进行去标识化处理，去标识化处理的信息将无法识别主体。请您了解并同意，在此情况下我们有权使用已经去标识化的信息