接收第三方商家的广告信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">(c) </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">委托我们进行推广的合作伙伴。有时我们会代表其他企业向使用我们产品与<span lang=\"EN-US\">/</span>或服务的用户群提供促销推广的服务。我们可能会使用您的个人信息以及您的非个人信息集合形成的间接用户画像与委托我们进行推广的合作伙伴（<span lang=\"EN-US\">&ldquo;</span>委托方<span lang=\"EN-US\">&rdquo;</span>）共享，但我们仅会向这些委托方提供推广的覆盖面和有效性的信息，而不会提供您的个人身份信息，或者我们将这些信息进行汇总，以便它不会识别您个人。比如我们可以告知该委托方有多少人看了他们的推广信息或在看到这些信息后购买了委托方的商品，或者向他们提供不能识别个人身份的统计信息，帮助他们了解其受众或顾客。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">3.1.4 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">对我们与之共享个人信息的公司、组织和个人，我们会与其签署严格的保密协定，要求他们按照我们的说明、本隐私政策以及其他任何相关的保密和安全措施来处理个人信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">3.1.5 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">为了遵守法律、执行或适用我们的使用条件和其他协议，或者为了保护</span><span style=\"font-family:&#10;宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">、您或其他</span><span style=\"font-family:宋体;&#10;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">客户的权利及其财产或安全，比如为防止欺诈等违法活动和减少信用风险，而与其他公司和组织交换信息。不过<span lang=\"EN-US\">,</span>这并不包括违反本隐私政策中所作的承诺而为获利目的出售、出租、共享或以其它方式披露的个人信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">3.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">转让<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们不会将您的个人信息转让给任何公司、组织和个人，但以下情况除外：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">3.2.1 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">事先获得您明确的同意或授权；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">3.2.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">根据适用的法律法规、法律程序的要求、强制性的行政或司法要求所必须的情况进行提供；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">3.2.3 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">符合与您签署的相关协议（包括在线签署的电子协议以及相应的平台规则）或其他的法律文件约定所提供；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">3.2.4 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">在涉及合并、收购、资产转让或类似的交易时，如涉及到个人信息转让，我们会要求新的持有您个人信息的公司、组织继续受本隐私政策的约束，否则<span lang=\"EN-US\">,</span>我们将要求该公司、组织重新向您征求授权同意。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">3.3 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">公开披露<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们仅会在以下情况下，且采取符合业界标准的安全防护措施的前提下，才会公开披露您的个人信息：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">3.3.1 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">根据您的需求，在您明确同意的披露方式下披露您所指定的个人信息；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">3.3.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">根据法律、法规的要求、强制性的行政执法或司法要求所必须提供您个人信息的情况下，我们可能会依据所要求的个人信息类型和披露方式公开披露您的个人信息。在符合法律法规的前提下，当我们收到上述披露信息的请求时，我们会要求必须出具与之相应的法律文件，如传票或调查函。我们坚信，对于要求我们提供的信息，应该在法律允许的范围内尽可能保持透明。我们对所有的请求都进行了慎重的审查，以确保其具备合法依据，且仅限于执法部门因特定调查目的且有合法权利获取的数据。在法律法规许可的前提下，我们披露的文件均在加密密钥的保护之下。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">&nbsp;<o:p></o:p></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><strong><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">四、我们如何保护和保存您的个人信息</span></strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\"><o:p></o:p></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.1 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们保护您个人信息的技术与措施<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们非常重视个人信息安全，并采取一切合理可行的措施，保护您的个人信息：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.2.1 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们会采取适当的、符合业界标准的安全措施和技术手段，以保护您的个人信息，包括但不限于制定了严格的内部信息管理流程、对数据进行加密、定岗定责、举办安全和隐私保护培训课程，加强员工对于保护个人信息重要性的认识、控制访问权限、采取安全措施等，以防止其丢失、被非法使用、受到未授权访问或泄漏、被篡改或毁坏。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.2.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们仅允许有必要知晓这些信息的</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">及</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;&#10;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:&#10;-webkit-standard;mso-bidi-font-family:-webkit-standard;color:black\">关联方的员工、合作伙伴访问个人信息，并为此设置了严格的访问权限控制和监控机制。我们同时要求可能接触到您个人信息的所有人员履行相应的保密义务。如果未能履行这些义务，可能会被追究法律责任或被中止与</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">的合作关系。我们同时要求可能接触到您个人信息的所有人员履行相应的保密义务。如果未能履行这些义务，可能会被追究法律责任或被中止与</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">的合作关系。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.2.3 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">为了保护您的信息安全，如果您的个人信息有误，我们会在严格验证并核实申请人身份后，根据您的要求访问、修正或删除相关信息（除非我们出于合法的原因而必须保留这些个人信息）。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.2.4 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">如果一旦发生安全事件影响到您的个人信息安全的，我们将通过您预留的邮箱、电话、系统推送等方式通知您，并告知您降低或防范相关风险的建议等信息。必要时，我们将根据适用的法律、法规通知主管部门。同时，我们会及时处置系统漏洞、网络攻击、病毒侵袭及网络侵入等安全风险。在发生危害网络安全的事件时，我们会按照网络安全事件应急预案，及时采取相应的补救措施，并按照规定向有关主管部门报告。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.2.5&nbsp; </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">如果您对我们的个人信息保护有任何疑问，可通过本政策上的联系方式联系我们。如您发现自己的个人信息泄密，尤其是您的账户及密码发生泄露，请您立即通过本政策提供的联系方式联络我们，以便我们采取相应措施。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.3 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">您个人信息的保存<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.3.1 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">您的个人信息将全被存储于中华人民共和国境内。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.3.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">除非法律法规另有规定，您的个人信息我们将保存至您账号注销之日后的一个月。我们承诺这是为了保证您在</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">购物的消费者权益，您个人信息在</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">须保存的最短期间。当您的个人信息超出我们所保存的期限后，我们会对您的个人信息进行删除或匿名化处理。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.3.3 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">请您注意，当您成功申请注销</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">账户后，我们给予您自注销之日起一个月的<span lang=\"EN-US\">&ldquo;</span>后悔期<span lang=\"EN-US\">&rdquo;</span>，在这个期间内您可以随时申请恢复您已经注销的</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户。为了实现您恢复您</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户的功能，我们将不会在<span lang=\"EN-US\">&ldquo;</span>后悔期<span lang=\"EN-US\">&rdquo;</span>内对您的个人信息进行删除或匿名化处理。如您在<span lang=\"EN-US\">&ldquo;</span>后悔期<span lang=\"EN-US\">&rdquo;</span>内没有要求恢复您的</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户或您明确向我们表述不再恢复您的</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户，我们将根据法律法规的要求对您的个人信息进行删除或匿名化处理。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.3.4 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">如果我们终止服务或运营，我们会至少提前三十日向您通知，并在终止服务或运营后对您的个人信息进行删除或匿名化处理。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">4.3.5 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">除非获得您的特别同意，或者满足法律规定的评估及许可程序，我们不会跨境转移您的个人信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">&nbsp;<o:p></o:p></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><strong><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">五、您如何管理您的个人信息</span></strong><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\"><o:p></o:p></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.1</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">非常重视您对个人信息的关注，并尽全力保护您对于您个人信息访问、更正、删除以及撤回同意的权利，以使您拥有充分的能力保障您的隐私和安全。您的权利包括：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">访问和更正您的个人信息<span lang=\"EN-US\">:</span>除法律法规规定外，您有权随时访问和更正您的个人信息（但使用第三方账号授权或关联登录的除外）、收货信息、订单信息、评论信息等。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.3 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">您无法访问和更正的个人信息：除上述列明的信息外，您的部分个人信息我们还无法为您提供访问和更正的服务，这些信息主要是为了提升您的用户体验和保证交易安全所收集的您的设备信息、您使用附加功能时产生的个人信息。上述信息我们会在您的授权范围内进行使用，您无法访问和更正，但您可联系我们进行删除或做匿名化处理。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.4 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">删除您的个人信息<span lang=\"EN-US\">:</span>您在我们的产品与<span lang=\"EN-US\">/</span>或服务页面中可以直接清除或删除的信息，包括订单信息、浏览信息、收货地址信息；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.5 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">在以下情形中，您可以向我们提出删除个人信息的请求：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.5.1 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">如果我们处理个人信息的行为违反法律法规；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.5.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">如果我们收集、使用您的个人信息，却未征得您的同意；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.5.3 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">如果我们处理个人信息的行为违反了与您的约定；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.5.4 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">如果您注销了</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">账户；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.5.5 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">如果我们终止服务及运营。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.6 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">若我们决定响应您的删除请求，我们还将同时通知从我们获得您的个人信息的实体，要求其及时删除，除非法律法规另有规定，或这些实体获得您的独立授权。当您从我们的服务中删除信息后，我们可能不会立即备份系统中删除相应的信息，但会在备份更新时删除这些信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.7 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">改变您授权同意的范围或撤回您的授权<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.7.1 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">您可以通过删除信息、关闭设备功能等方式改变您授权我们继续收集个人信息的范围或撤回您的授权。您也可以通过注销账户的方式，撤回我们继续收集您个人信息的全部授权。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.7.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">请您理解，每个业务功能需要一些基本的个人信息才能得以完成，当您撤回同意或授权后，我们无法继续为您提供撤回同意或授权所对应的服务，也不再处理您相应的个人信息。但您撤回同意或授权的决定，不会影响此前基于您的授权而开展的个人信息处理。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.8 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">注销账户<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">5.8.1</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">请您注意，如果您存在完成不满三个月的订单，可能需要您履行完毕后方可注销账户。由于您在</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">的用户账户与</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户系统进行绑定，关于您注销账户的方式以及您应满足的条件，请详见《</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户注销须知》 。您注销账户后，我们将停止为您提供产品与<span lang=\"EN-US\">/</span>或服务，并依据您的要求，除法律法规另有规定外，我们将删除您的个人信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><strong><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">六、通知和修订</span></strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\"><o:p></o:p></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">6.1 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">为给您提供更好的服务以及随着</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">业务的发展，本隐私政策也会随之更新。但未经您明确同意，我们不会削减您依据本隐私政策所应享有的权利。我们会通过在</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">网站、</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">移动端上发出更新版本并在生效前通过网站公告或以其他适当方式提醒您相关内容的更新，也请您访问</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">以便及时了解最新的隐私政策。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">6.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">对于重大变更，我们还会提供更为显著的通知（我们会通过包括但不限于邮件、短信或在浏览页面做特别提示等方式，说明隐私政策的具体变更内容）。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">本政策所指的重大变更包括但不限于：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">6.2.1</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们的服务模式发生重大变化。如处理个人信息的目的、处理的个人信息类型、个人信息的使用方式等；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">6.2.2 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们在所有权结构、组织架构等方面发生重大变化。如业务调整、破产并购等引起的所有者变更等；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">6.2.3 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">个人信息共享、转让或公开披露的主要对象发生变化；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">6.2.4 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">您参与个人信息处理方面的权利及其行使方式发生重大变化；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">6.2.5 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">我们负责处理个人信息安全的责任部门、联络方式及投诉渠道发生变化时；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">6.2.6 </span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">个人信息安全影响评估报告表明存在高风险时。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">&nbsp;<o:p></o:p></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><strong><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">七、未成年人的个人信息保护</span></strong><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">&nbsp;<o:p></o:p></span></p>\r\n<p style=\"margin-bottom:15.0pt;mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">7.1 </span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">非常重视对未成年人个人信息的保护。若您是<span lang=\"EN-US\">18</span>周岁以下的未成年人，在使用我们的产品与<span lang=\"EN-US\">/</span>或服务前，应事先取得您家长或法定监护人的书面同意。</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">根据国家相关法律法规的规定保护未成年人的个人信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"margin-bottom:15.0pt;mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">7.2 </span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">对于经父母或法定监护人同意而收集未成年人个人信息的情况，我们只会在受到法律允许、父母或监护人明确同意或者保护未成年人所必要的情况下使用或公开披露此信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"margin-bottom:15.0pt;mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">7.3 </span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">如果我们发现自己在未事先获得可证实的父母或法定监护人同意的情况下收集了未成年人的个人信息，则会设法尽快删除相关数据。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">&nbsp;<o:p></o:p></span></p>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\"><strong><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">八、免责声明（非常重要）</span></strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\"><o:p></o:p></span></p>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\"><strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">8.1 </span></strong><strong><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">当您以适当的方式开始、继续使用我们的产品或服务超过<span lang=\"EN-US\">15</span>日的，您未通过适当的方式联系我们并表达相反意见的，我们将视为您充分理解并同意本政策。</span></strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\"><o:p></o:p></span></p>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\"><strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">8.2 </span></strong><strong><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">请您理解，互联网并非绝对安全的环境，电子邮件、即时通讯、社交软件、交易平台等与其他用户的交流方式无法确定是否完全加密，请您在进行交互使用时，注意保护您个人信息的安全。</span></strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\"><o:p></o:p></span></p>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\"><strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">8.3 </span></strong><strong><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">请您理解，由于计算机及互联网技术的飞速发展及同步速度的限制，可能存在或出现各种恶意或非恶意的攻击手段。虽然我们持续致力于提升和加强安全措施，以保护您的个人信息免遭意外或破坏，但仍无法始终保证您的个人信息的百分之百安全。</span></strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\"><o:p></o:p></span></p>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\"><strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">8.4 </span></strong><strong><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">请您理解，您使用产品或服务时所用的系统和通讯网络，或硬件设备等我们均无法控制，请您了解并注意保护您的个人信息安全。</span></strong><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">除非本隐私政策有其他规定，为了保护您的人身及财产安全，我们特别提醒您不要通过公共网络，向我们或任何以我们名义为您提供服务的第三方，提供您的财产状况、健康生理、账户密码或验证码、个人轨迹、通信内容等信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">&nbsp;<o:p></o:p></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">特别提示：本《</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">隐私政策》将于发布之日正式生效，除非</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">平台根据相关法律法规及平台运营对本疑似政策作出调整并发布新的隐私政策，否则本隐私政策一直有效。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:&#10;-webkit-standard;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:&#10;-webkit-standard;color:black\">&nbsp;<o:p></o:p></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><strong><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">附件一</span></strong><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">《</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;&#10;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:&#10;-webkit-standard;mso-bidi-font-family:-webkit-standard;color:black\">账户注销须知》<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><strong><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">【特别提示】</span></strong><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">当您按照注销页面提示填写信息、阅读并同意本《注销须知》、《</span><span style=\"font-family:宋体;&#10;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">用户协议》、《</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">隐私规则》等</span><span style=\"font-family:宋体;mso-bidi-font-family:&#10;宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">平台的相关条款与条件且完成全部注销程序后，即表示您已充分阅读、理解并接受上述协议的全部内容。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">阅读本《注销须知》的过程中，如果您不同意相关任何条款和条件约定，您可以通过网上客服电话联系我们。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;&#10;mso-fareast-font-family:-webkit-standard;mso-bidi-font-family:-webkit-standard;&#10;color:black\">亲爱的</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;&#10;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:&#10;-webkit-standard;mso-bidi-font-family:-webkit-standard;color:black\">平台用户：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">我们对您注销</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户的决定深表遗憾与歉意。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">我们在此善意的提醒您，你注销</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户的行为会给您的售后维权带来诸多不便，且注销</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户后，您的个人信息我们会根据法律法规的要求及《</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">隐私规则》的约定进行删除或处理。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">&nbsp;&nbsp;</span><strong><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">如果您仍执意注销账户，您的账户需同时满足以下条件：</span></strong><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\"><o:p></o:p></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">（<span lang=\"EN-US\">1</span>）在最近一个月内，账户没有进行更改密码、更改绑定信息等敏感操作，账户没有被盗、被封等风险；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">（<span lang=\"EN-US\">2</span>）账户在</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">系统中无资产和虚拟权益（包括但不限于账户余额、优惠券等）；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">（<span lang=\"EN-US\">3</span>）账户内无未完成的订单、服务，且所有订单完成达三个月以上；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">（<span lang=\"EN-US\">4</span>）账户内订单或服务无任何纠纷，包括投诉举报或被投诉举报；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">如果您确定注销</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户，并已操作注销事宜，将表示您对上述事项均予以确认。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">2</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">、在注销</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户期间，如果您的</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户涉及争议纠纷，包括但不限于投诉、举报、诉讼、仲裁、国家有权机关调查等，</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">有权自行终止本</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户的注销无需另行得到您的同意。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">3</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">、注销</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户后，您将无法再使用该账户登录</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">APP</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">，也将无法找回您</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户中该账户相关的任何内容或信息，包括但不限于：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">（<span lang=\"EN-US\">1</span>）您将无法登录、使用</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">APP</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">，您曾获得的余额、优惠券、积分、资格、订单等视为您自行放弃，将无法继续使用；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">（<span lang=\"EN-US\">2</span>）</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户的个人资料和历史信息（包括但不限于用户名、头像、购物记录、关注信息等）都将无法找回；<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">（<span lang=\"EN-US\">3</span>）您理解并同意，</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">无法协助您重新恢复前述服务。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:21.0pt;mso-pagination:widow-orphan\"><span lang=\"EN-US\" style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">4</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">、如果您需要继续使用</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">服务，您可以重新注册</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">凯宇生鲜</span><span style=\"font-family:-webkit-standard;mso-fareast-font-family:-webkit-standard;&#10;mso-bidi-font-family:-webkit-standard;color:black\">账户。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p>', '', '', '', '0', '1', '1542607795', '', '0', 'http://', '', '0');
