INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description`, `help_type` ) VALUES  ('6', '-1', '用户协议', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-size:22.0pt;mso-bidi-font-size:15.0pt;font-family:宋体;mso-ascii-theme-font:&#10;minor-fareast;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;&#10;mso-hansi-theme-font:minor-fareast\">特别提示<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent:35.45pt\"><span style=\"font-size:15.0pt;&#10;font-family:宋体;mso-ascii-theme-font:minor-fareast;mso-fareast-font-family:宋体;&#10;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-fareast\">在注册成为用户之前，请认真阅读本《用户协议》（以下简称&ldquo;协议&rdquo;），确保您充分理解本协议中各条款。请您审慎阅读并选择接受或不接受本协议。除非您接受本协议所有条款，否则您无权注册、登录或使用本协议所涉服务。您的注册、登录、使用等行为将视为对本协议的接受，并同意接受本协议各项条款的约束。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent:35.45pt\"><span style=\"font-size:15.0pt;&#10;font-family:宋体;mso-ascii-theme-font:minor-fareast;mso-fareast-font-family:宋体;&#10;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-fareast\">本协议约定凯宇生鲜与用户之间关于&ldquo;凯宇生鲜&rdquo;软件服务（以下简称&ldquo;服务&rdquo;）的权利义务。&ldquo;用户&rdquo;是指注册、登录、使用本服务的个人。本协议可由凯宇生鲜随时更新，更新后的协议条款一旦公布即代替原来的协议条款，恕不再另行通知，用户可在本网站查阅最新版协议条款。在凯宇生鲜修改协议条款后，如果用户不接受修改后的条款，请立即停止使用凯宇生鲜提供的服务，用户继续使用凯宇生鲜提供的服务将被视为接受修改后的协议。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent:35.45pt\"><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-ascii-theme-font:minor-fareast;&#10;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:&#10;minor-fareast\">1</span><span style=\"font-size:15.0pt;font-family:宋体;mso-ascii-theme-font:&#10;minor-fareast;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;&#10;mso-hansi-theme-font:minor-fareast\">、用户在使用本服务前需要注册一个&ldquo;凯宇生鲜&rdquo;帐号。&ldquo;凯宇生鲜&rdquo;帐号应当使用手机号码绑定注册，请用户使用尚未与&ldquo;凯宇生鲜&rdquo;帐号绑定的手机号码，以及未被凯宇生鲜根据本协议封禁的手机号码注册&ldquo;凯宇生鲜&rdquo;帐号。凯宇生鲜可以根据用户需求或产品需要对帐号注册和绑定的方式进行变更，而无须事先通知用户。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent:35.45pt\"><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-ascii-theme-font:minor-fareast;&#10;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:&#10;minor-fareast\">2</span><span style=\"font-size:15.0pt;font-family:宋体;mso-ascii-theme-font:minor-fareast;&#10;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:&#10;minor-fareast\">、在用户注册及使用本服务时，凯宇生鲜需要搜集能识别用户身份的个人信息以便凯宇生鲜可以在必要时联系用户，或为用户提供更好的使用体验。凯宇生鲜搜集的信息包括但不限于用户的姓名、性别、年龄、出生日期、身份证号、地址、学校情况、公司情况、所属行业、兴趣爱好、常出没的地方、个人说明；凯宇生鲜同意对这些信息的使用将受限于第三条用户个人隐私信息保护的约束。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p>&nbsp;</p>', '', '', '', '0', '1', '1542607795', '', '0', 'http://', '', '0');
