n: center;\">&nbsp;</p>\r\n<p style=\"font-size: 12.8px; text-align: center;\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-size: 12.8px; text-align: center;\">&nbsp;</p>\r\n<p style=\"font-size: 12.8px; text-align: center;\"><span style=\"font-size: larger;\">配送收费标准:</span></p>\r\n<p style=\"font-size: 12.8px; text-align: center;\"><span style=\"font-size: larger;\">1.订单金额&ge;100元，免收运费；</span></p>\r\n<p style=\"font-size: 12.8px; text-align: center;\"><span style=\"font-size: larger;\">2.订单金额&lt;100元；运费15元</span></p>\r\n<p style=\"font-size: 12.8px; text-align: center;\"><span style=\"font-size: larger;\">3.配送到凯宇定点合作单位，免收运费</span></p>\r\n<p style=\"font-size: 12.8px; text-align: center;\"><span style=\"font-size: larger;\">&nbsp;凯宇生鲜超市门店自提，免收运费</span></p>\r\n<p style=\"font-size: 12.8px; text-align: center;\">&nbsp;</p>\r\n<p style=\"font-size: 12.8px; text-align: center;\"><span style=\"font-size: large;\"><u>质量保证：️货源保证 ️加工流程规范 ️包装生态环保安全 ️计量手段科学准确</u></span></p>\r\n<p style=\"font-size: 12.8px; text-align: center;\"><span style=\"font-size: large;\"><u>（但因为生鲜是易耗品及固有特性，商品质量与标注质量误差10%为正常现象）</u></span></p>\r\n<p style=\"font-size: 12.8px; text-align: center;\">&nbsp;</p>\r\n<p style=\"font-size: 12.8px; text-align: center;\"><strong><span style=\"font-size: xx-large;\">7天无理由退货政策</span></strong></p>\r\n<p style=\"font-size: 12.8px; text-align: center;\">&nbsp;</p>\r\n<p style=\"font-size: 12.8px; text-align: center;\">对于您（消费者）通过凯宇生鲜购买的商品，自您实际收到商品之日起7日内，在商品完好未开封使用以及包装、附件及赠品（若有）完整、</p>\r\n<p style=\"font-size: 12.8px; text-align: center;\">且退货的相应返回运费由您承担的情况下,可享受&ldquo;七天无理由退货&rdquo;政策；但根据法律规定及商品性质，以下商品不适用&ldquo;七天无理由退货&rdquo;政策：</p>\r\n<p style=\"font-size: 12.8px; text-align: center;\">1. 用户定制的商品；</p>\r\n<p style=\"font-size: 12.8px; text-align: center;\">2. 鲜活易腐商品，包含鲜奶，冷藏食品，冷冻食品，新鲜水果，新鲜蔬菜，禽肉禽蛋，猪牛羊肉，海鲜水产、水产肉类加工品及其他鲜活易腐商品等交付的报纸、期刊类商品；</p>\r\n<p style=\"font-size: 12.8px; text-align: center;\">3. 食用类商品，例如食品、保健品、饮料、药品、酒类、奶粉、婴童辅食、婴童营养品、孕妇食品/营养品等；</p>\r\n<p style=\"font-s